e zwiększyć ryzyko bezpieczeństwa. Nowe hasło zwiększa poziom ochrony.','Not used recently'=>'Nieużywane ostatnio','Using a password similar to your username or email makes it easier to guess.'=>'Jeśli użyjesz hasła podobnego do nazwy użytkownika lub adresu e-mail, będzie je łatwiej odgadnąć.','Doesn\'t match existing user data'=>'Nie pasuje do istniejących danych użytkownika','If found in a public breach, this password may already be known to attackers.'=>'Jeśli hasło to zostanie znalezione w wyniku publicznego włamania, atakujący mogą już je znać.','Not a leaked password'=>'Nie jest to wyciekłe hasło','Between 6 and 150 characters'=>'Od 6 do 150 znaków','Doesn\'t contain a backslash (\\) character'=>'Nie zawiera znaku ukośnika odwrotnego (\\)','Passwords should meet WordPress core security requirements to enhance account protection.'=>'Hasła powinny spełniać podstawowe wymagania bezpieczeństwa WordPressa, aby zapewnić lepszą ochronę konta.','Strong password'=>'Silne hasło','Invalid nonce.'=>'Nieprawidłowy kod jednorazowy.','No password provided.'=>'Nie podano hasła.','Authentication code verification failed. Please try again.'=>'Weryfikacja kodu uwierzytelniającego nie powiodła się. Spróbuj ponownie.','Authentication code verified successfully.'=>'Kod uwierzytelniający został pomyślnie zweryfikowany.','Resend email'=>'Wyślij ponownie e-mail','Didn\'t get the code?'=>'Nie otrzymałeś kodu?','reset your password'=>'zresetuj swoje hasło','If you did not receive your authentication code, please try again later or %s now.'=>'Jeśli nie otrzymałeś kodu uwierzytelniającego, spróbuj ponownie później lub %s teraz.','The website URL of the person who submitted the form.'=>'Adres URL witryny osoby, która przesłała formularz.','The email address of the person who submitted the form.'=>'Adres e-mail osoby, która wysłała formularz.','The name of the person who submitted the form.'=>'Nazwa osoby, która przesłała formularz.','Unique identifier for the form response.'=>'Unikatowy id