						 <p>Wszystkie pozostałe pytania są obsługiwane przez nasz zespół tak szybko, jak tylko jesteśmy w stanie uzyskać odpowiedź na forum wsparcia WordPress.</p>','Open overlay from filter links'=>'Otwórz nakładkę z odnośników filtrujących','Open overlay when filters are used outside the Jetpack Sidebar'=>'Otwórz nakładkę, gdy filtry są używane poza panelem bocznym Jetpack','Filtering Search Overlay'=>'Nakładka filtrująca wyszukiwanie','Video player for %s'=>'Odtwarzacz filmu dla %s','Paste a VideoPress URL or Video ID'=>'Wklej adres URL VideoPress lub identyfikator filmu','URL or Video ID'=>'Adres URL lub identyfikator filmu','Severity labels'=>'Etykiety ważności','One-click auto fixes'=>'Automatyczne poprawki jednym kliknięciem','Access to scan on Cloud'=>'Dostęp do skanowania w chmurze','Automatic protection and rule updates'=>'Automatyczna ochrona i aktualizacje reguł','Manual rules only'=>'Tylko zasady ręczne','Plus on-demand manual scans'=>'Oraz skanowanie ręczne na żądanie','Daily automated scans'=>'Codzienne automatyczne skanowanie','Line by line malware scanning'=>'Skanowanie złośliwego oprogramowania linia po linii','Check items against database'=>'Sprawdź elementy w bazie danych','Scan for threats and vulnerabilities'=>'Skanuj w poszukiwaniu zagrożeń i luk','Dedicated email support'=>'Dedykowane wsparcie e-mailowe','Deliver images from Jetpack\'s Content Delivery Network. Automatically resizes your images to an appropriate size, converts them to modern efficient formats like WebP, and serves them from a worldwide network of servers.'=>'Dostarczaj obrazki z sieci dostarczania treści Jetpack. Automatycznie dopasowuje rozmiar obrazków do odpowiedniego rozmiaru, konwertuje je do nowoczesnych, wydajnych formatów, takich jak WebP, i udostępnia z globalnej sieci serwerów.','Image CDN'=>'Obrazek CDN','Discover and fix images with a suboptimal resolution, aspect ratio, or file size, improving user experience and page speed.'=>'Znajdź i napraw obrazki o nieoptymalnej rozdzielczości, proporcjach obrazu lub rozmiarze pliku, poprawiając komfort użytkowania i szybkość wczytywanie strony.','Image guide'=>'Przewodnik po obrazkach','Run non-essential JavaScript after the page has loaded so that styles and images can load more quickly.'=>'Uruchom nieistotny kod JavaScript po wczytaniu strony, aby style i obrazki wczytywały się szybciej.','Defer non-essential JavaScript'=>'Odłóż nieistotny JavaScript','<p>It’s essential to regenerate Critical CSS to optimize your site speed whenever your HTML or CSS structure changes. Being on top of this can be tedious and time-consuming.</p>
								 <p>Boost’s cloud service can automatically detect when your site needs the Critical CSS regenerated, and perform this function behind the scenes without requiring you to monitor it manually.</p>'=>'<p>Regeneracja krytycznego kodu CSS jest niezbędna do optymalizacji szybkości działania witryny za każdym razem, gdy zmienia się struktura HTML lub CSS. Nadążanie za tym może być żmudne i czasochłonne.</p>
								 <p>Usługa w chmurze Boost automatycznie wykrywa, kiedy witryna wymaga regeneracji krytycznego kodu CSS i wykonuje tę funkcję w tle, bez konieczności ręcznego monitorowania.</p>','Automatic Critical CSS regeneration'=>'Automatyczna regeneracja krytycznego CSS','<p>To enhance the speed of your site, with this plan you will need to optimize CSS by using the Manual Critical CSS generation feature whenever you:</p>
								<ul>
									<li>Make theme changes.</li>
									<li>Write a new post/page.</li>
									<li>Edit a post/page.</li>
									<li>Activate, deactivate, or update plugins that impact your site layout or HTML structure.</li>
									<li>Change settings of plugins that impact your site layout or HTML structure.</li>
									<li>Upgrade your WordPress version if the new release includes core CSS changes.</li>
								</ul>'=>'<p>Aby zwiększyć szybkość działania witryny, w ramach tego planu będziesz musiał optymalizować CSS, korzystając z funkcji ręcznego generowania krytycznego kodu CSS za każdym razem, gdy:</p>
								<ul>
									<li>Wprowadzasz zmiany w motywie.</li>
									<li>Piszesz nowy wpis/stronę.</li>
									<li>Edytujesz wpis/stronę.</li>
									<li>Włączasz, wyłączasz lub aktualizujesz wtyczki, które wpływają na układ witryny lub strukturę HTML.</li>
									<li>Zmieniasz ustawienia wtyczek, które wpływają na układ witryny lub strukturę HTML.</li>
									<li>Aktualizujesz wersję WordPressa, jeśli nowa wersja zawiera podstawowe zmiany w kodzie CSS.</li>
								</ul>','Manual Critical CSS regeneration'=>'Ręczna regeneracja krytycznego CSS','Move important styling information to the start of the page, which helps pages display your content sooner, so your users don’t have to wait for the entire page to load. Commonly referred to as Critical CSS.'=>'Przenieś ważne informacje o stylu na początek strony, co pomoże stronom szybciej wyświetlać zawartość, dzięki czemu użytkownicy nie będą musieli czekać na wczytanie całej strony. To potocznie nazywane krytycznym CSS.','HTTP %d while communicating with WordPress.com'=>'HTTP %d podczas komunikacji z WordPress.com','The url parameter is required'=>'Parametr adresu URL jest wymagany','Invalid response from WPCOM API while polling for speed scores'=>'Nieprawidłowa odpowiedź z interfejsu API WPCOM podczas sondowania wyników szybkości','Source URL: %1$s'=>'Adres URL źródła: %1$s','IP Address: %1$s'=>'Adres IP: %1$s','Time: %1$s'=>'Czas: %1$s','nounTrash'=>'Kosz','Paid Subscribers'=>'Płatni subskrybenci','verbTrash'=>'Przenieś do kosza','Ask'=>'Zapytaj','Mark as spam'=>'Oznacz jako spam','Some themes and plugins have <a href="%1$s" target="_blank" rel="noopener noreferrer">known conflicts</a> with Jetpack – check the list. (You can also browse the <a href="%2$s" target="_blank" rel="noopener noreferrer">Jetpack support pages</a> or <a href="%3$s" target="_blank" rel="noopener noreferrer">Jetpack support forum</a> to see if others have experienced and solved the problem.)'=>'Niektóre motywy i wtyczki mają <a href="%1$s" target="_blank" rel="noopener noreferrer">znane konflikty</a> z Jetpackiem – sprawdź listę. (Możesz także przeszukać  <a href="%2$s" target="_blank" rel="noopener noreferrer">strony pomocy technicznej Jetpacka</a> lub <a href="%3$s" target="_blank" rel="noopener noreferrer">forum wsparcia Jetpacka</a> aby zobaczyć, czy ktoś napotkał i rozwiązał problem.)','We strive to live by the <a href="https://automattic.com/creed/" target="_blank" class="jptracks" data-jptra