erly. Please connect to your WordPress.com account via the button below. Once you connect, you may refresh this page to see an option to change the connection owner.'=>'Każda witryna Jetpack wymaga co najmniej jednego połączonego administratora, aby funkcje działały poprawnie. Połącz się ze swoim kontem WordPress.com za pomocą poniższego przycisku. Po połączeniu możesz odświeżyć tę stronę, aby zobaczyć opcję zmiany właściciela połączenia.','Set new connection owner'=>'Ustaw nowego właściciela połączenia','You can choose to transfer connection ownership to one of these already-connected admins:'=>'Możesz zdecydować się na przeniesienie własności połączenia na jednego z tych już połączonych administratorów:','Warning! You are about to delete the Jetpack connection owner (%s) for this site, which may cause some of your Jetpack features to stop working.'=>'Ostrzeżenie! Zamierzasz usunąć właściciela połączenia Jetpack (%s) dla tej witryny, co może spowodować, że niektóre funkcje Jetpack przestaną działać.','Important notice about your Jetpack connection:'=>'Ważna informacja dotycząca połączenia Jetpack:','Last heartbeat sent at: %s'=>'Ostatnie uderzenie serca wysłane o: %s','Invalid blog token'=>'Nieprawidłowy token bloga','Invalid token for user %d'=>'Nieprawidłowy token dla użytkownika %d','No blog token found'=>'Nie znaleziono tokena bloga','Requesting user_id %1$d does not match token user_id %2$d'=>'Żądanie identyfikatora użytkownika %1$d nie pasuje do tokena identyfikatora użytkownika %2$d','Token for user %d is malformed'=>'Token dla użytkownika %d jest nieprawidłowy','No token for user %d'=>'Brak tokena dla użytkownika %d','No primary user defined'=>'Nie zdefiniowano żadnego użytkownika podstawowego','No user tokens found'=>'Nie znaleziono tokenów użytkownika','Secret mismatch'=>'Niezgodność tajna','Verification secrets are incomplete'=>'Tajniki weryfikacji są niekompletne','Verification secrets are empty'=>'Tajniki weryfikacji są puste','Verification took too long'=>'Weryfikacja trwała zbyt długo','Verification secrets not found'=>'Nie znaleziono tajników weryfikacji','The required "%s" parameter is malformed.'=>'Wymagany parametr „%s” jest nieprawidłowy.','Failed to disconnect the site as it appears already disconnected.'=>'Nie udało się odłączyć witryny, ponieważ wygląda na to, że jest już odłączona.','Site is not connected'=>'Witryna nie jest połączona','Invalid user id is provided'=>'Podano nieprawidłowy identyfikator użytkownika','Invalid user token is provided'=>'Podano nieprawidłowy token użytkownika','New owner'=>'Nowy właściciel','Is connection owner'=>'Jest właścicielem połączenia','New user token'=>'Nowy token użytkownika','Indicates from what plugin the request is coming from'=>'Wskazuje, z jakiej wtyczki pochodzi żądanie','URI of the admin page where the user should be redirected after connection flow'=>'Adres URI strony administracyjnej, na którą użytkownik powinien zostać przekierowany po nawiązaniu połączenia','Indicates where the registration action was triggered for tracking/segmentation purposes'=>'Wskazuje miejsce, w którym została uruchomiona akcja rejestracji w celu śledzenia/segmentacji','The isActive argument should be set to false.'=>'Argument isActive powinien zostać ustawiony na false.','Set to false will trigger the site to disconnect.'=>'Ustawienie wartości false spowoduje rozłączenie witryny.','The request method is missing.'=>'Brak metody żądania.','You cannot call this method until Jetpack Config is configured'=>'Nie można wywołać tej metody, dopóki konfiguracja Jetpack nie zostanie skonfigurowana','Invalid Registration State'=>'Nieprawidłowy stan rejestracji','Jetpack experienced an issue trying to save options (cannot_save_secrets). We suggest that you contact your hosting provider, and ask them for help checking that the options table is writable on your site.'=>'Jetpack napotkał problem podczas próby zapisania opcji (cannot_save_secrets). Sugerujemy kontakt z dostawcą hostingu i poprosze