ęki potężnym narzędziom WordPress Jetpack.','Loading…'=>'Wczytywanie…','Jetpack logo'=>'Logo Jetpack','Jetpack Logo'=>'Logo Jetpack','product name shown in menuSearch'=>'Szukaj','To specify a range, enter the low value and high value separated by a dash. Example: 12.12.12.1-12.12.12.100'=>'Aby określić zakres, wpisz wartość minimalną i maksymalną, rozdzielając je myślnikiem. Przykład: 12.12.12.1-12.12.12.100','IPv4 and IPv6 are acceptable. Enter multiple IPs on separate lines.'=>'Dopuszczalne są adresy IPv4 i IPv6. Wprowadź wiele adresów IP w osobnych wierszach.','YouTube video'=>'Filmy z YouTube\'a','Inbox'=>'Skrzynka odbiorcza','Allow individual site administrators to manage their own connections (connect and disconnect) to WordPress.com'=>'Zezwól administratorom poszczególnych witryn na zarządzanie własnymi połączeniami (łączenie i rozłączanie) z WordPress.com','Hulu no longer allows embedding content.'=>'Hulu nie pozwala już na osadzanie treści.','Next quiz'=>'Następny quiz','Previous quiz'=>'Poprzedni quiz','Collapse upgrade nudges'=>'Zwiń zachęty do aktualizacji','CRM'=>'CRM','Install CRM'=>'Zainstaluj CRM','Activate CRM'=>'Włącz CRM','Improve your site\'s performance and SEO in a few clicks with the free Jetpack Boost plugin.'=>'Popraw wydajność swojej witryny i SEO za pomocą kilku kliknięć dzięki darmowej wtyczce Jetpack Boost.','Install Boost'=>'Zainstaluj Boost','Activate Boost'=>'Włącz Boost','Stay ahead of security threats with automated scanning and one-click fixes.'=>'Wyprzedzaj zagrożenia bezpieczeństwa dzięki automatycznemu skanowaniu i usuwaniu ich jednym kliknięciem.','Security, performance, and growth tools for %s'=>'Narzędzia bezpieczeństwa, wydajności i rozwoju dla %s','Performance and growth tools for %s'=>'Narzędzia wydajności i wzrostu dla %s','Like or Reblog'=>'Polub Reblog','Sell more and get more leads with the free Jetpack CRM plugin built specifically for WordPress.'=>'Sprzedawaj więcej i zdobądź więcej leadów dzięki wtyczce Jetpack CRM