n the internet, and to understand how users engage with those ads. Cookies collect certain information as part of the ads program, and we provide the following categories of information to third-party advertising partners: online identifiers and internet or other network or device activity (such as unique identifiers, cookie information, and IP address), and geolocation data (approximate location information from your IP address). This type of sharing with ads partners may be considered a "sale" of personal information under your state\'s privacy laws.'=>'Witryna obsługuje program reklamowy we współpracy z zewnętrznymi dostawcami, którzy pomagają w umieszczaniu reklam. Reklamowe pliki cookie umożliwiają tym partnerom reklamowym wyświetlanie reklam, personalizowanie tych reklam w oparciu o informacje takie jak wizyty w tej witrynie i innych witrynach w Internecie oraz zrozumienie, w jaki sposób użytkownicy komunikują się z tymi reklamami. Pliki cookie gromadzą pewne informacje w ramach programu reklamowego, a partnerom reklamowym udostępniamy następujące kategorie informacji: identyfikatory online i aktywność w Internecie lub innej sieci bądź urządzeniu (takie jak unikalne identyfikatory, informacje o plikach cookie i adres IP) oraz dane geolokalizacyjne (przybliżone informacje o lokalizacji na podstawie adresu IP). Ten rodzaj udostępniania danych partnerom reklamowym może być uznany za "sprzedaż" danych osobowych zgodnie z ustawą CCPA.','Please Wait'=>'Proszę czekać','Registration Form'=>'Formularz rejestracyjny','Could not retrieve Scan state.'=>'Nie można pobrać stanu skanowania.','%s must be an object.'=>'%s musi być obiektem.','Contact Us'=>'Skontaktuj się z nami','Feedback Form'=>'Formularz opinii','Appointment Form'=>'Formularz wizyty','RSVP Form'=>'Formularz potwierdzenia obecności','Scan state correctly received.'=>'Stan skanowania został poprawnie odebrany.','%s Threats found'=>'%s Znaleziono zagrożenia','Show comments area in carousel'=>'Pokaż obszar komen