ia motywu','Jetpack Safe Mode'=>'Tryb awaryjny Jetpack','Would you like to use Jetpack on your local development site? You can do so thanks to <a href="%s">Jetpack\'s offline mode</a>.'=>'Czy chcesz używać Jetpacka na swojej lokalnej witrynie deweloperskiej? Możesz to zrobić dzięki <a href="%s">trybowi offline Jetpacka</a>.','Your url is set as `%1$s`, but your WordPress.com connection lists it as `%2$s`!'=>'Twój adres URL jest ustawiony jako `%1$s`, ale połączenie WordPress.com wyświetla go jako `%2$s`!','Yandex Site Verification'=>'Weryfikacja strony Yandex','Invalid option: %s.'=>'Nieprawidłowa opcja: %s.' . "\0" . 'Nieprawidłowe opcje: %s.' . "\0" . 'Nieprawidłowych opcji: %s.','%s must be an array of post types.'=>'%s musi być tablicą typów treści.','The requested Jetpack data updates were successful.'=>'Żądana aktualizacja danych Jetpack powiodła się.','Could not confirm migration.'=>'Nie udało się potwierdzić migracji.','Could not delete sync error option.'=>'Nie można usunąć opcji błędu synchronizacji.','Could not confirm safe mode.'=>'Nie można potwierdzić trybu awaryjnego.','There was an error logging you in via WordPress.com, please try again or try logging in with your username and password.'=>'Wystąpił błąd podczas logowania przez WordPress.com, proszę spróbować ponownie lub zalogować się używając swojej nazwy użytkownika i hasła.','Logging in with WordPress.com is not currently available because this site is experiencing connection problems.'=>'Logowanie z użyciem WordPress.com jest obecnie niemożliwe ponieważ na stronie występują problemy z połączeniem.','There was an error creating a user for you. Please contact the administrator of your site.'=>'Wystąpił błąd podczas tworzenia twojego użytkownika. Proszę skontaktować się z administratorem witryny.','Your current IP: %1$s'=>'Twój obecny adres IP: %1$s','Invalid parameter "dismissed".'=>'Niepoprawny parametr "zwolniony".','Automatically create two sitemap files that list the URLs of posts and pages in your site.
