		including mosaic (default), square, and circular layouts.'=>'Dodając galerię obrazków, będziesz mieć możliwość tworzenia eleganckich układów mozaikowych w stylu magazynu dla swoich zdjęć,
		w tym układów mozaikowych (domyślnych), kwadratowych i okrągłych.','Publish posts on your site by writing and sending an email from any email client instead of using the post editor.'=>'Publikuj wpisy i strony, pisząc i wysyłając treść e-mailem za jakiegokolwiek programu pocztowego pomijając edytor w Wordpressie.','Infinite scrolling pulls the next set of posts automatically into view when the reader approaches
		the bottom of the page. This helps you reader see more of your content.'=>'Nieskończone przewijanie automatycznie wyświetla kolejny zestaw wpisów, gdy czytelnik zbliża się
		do dołu strony. Dzięki temu czytelnik może zobaczyć więcej treści.','Allow visitors to use their WordPress.com or Facebook accounts when commenting on
		your site. Jetpack will match your site\'s color scheme automatically (but you can adjust that).'=>'Zezwól odwiedzającym na korzystanie z kont WordPress.com lub Facebook podczas komentowania
		Twojej witryny. Jetpack automatycznie dopasuje kolorystykę witryny (ale możesz to zmienić).','Create simple contact forms without any coding. You can have multiple forms and when
		a user submits it, their feedback will be emailed directly to you. If Akismet is active, submissions will be
		automatically filtered for spam.'=>'Utwórz prosty formularz kontaktu bez potrzeby pisania kodu. Możesz mieć wiele formularzy, a kiedy użytkownik wyśle dane za pomocą formularza zostaniesz bezpośrednio powiadomiony za pomocą e-maila. Jeśli wtyczka Akismet jest włączona, przesyłane dane będą automatycznie filtrowane wyłapując spam.','Authorize applications and services to securely connect to your site. Developers can use WordPress.com\'s OAuth2
		authentication system and WordPress.com REST API to manage and access your site\'s content.'=>'Autoryzuj aplikacje i usługi, aby mogły bezpiecznie łączyć się z Twoją witryną. Deweloperzy mogą korzystać z systemu uwierzytelniania OAuth2
		WordPress.com oraz interfejsu API REST WordPress.com do zarządzania treścią witryny i uzyskiwania do niej dostępu.','Most sites will come under attack from automated bots that attempt to log in for malicious purposes.
		We protect you automatically from unauthorized access by using data from millions of sites.'=>'Większość witryn pada ofiarą ataków ze strony zautomatyzowanych botów, które próbują się logować w złośliwych celach.
		Automatycznie chronimy Cię przed nieautoryzowanym dostępem, wykorzystując dane z milionów witryn.','A widget in your sidebar allows visitors to subscribe to your site so that they receive an email
		each time you publish new content. Your visitors can also subscribe to a post\'s comments to keep up with the conversation.'=>'WIdget w pasku bocznym pozwala odwiedzającym twoją stronę subskrybować powiadomienie o każdej nowej treści. Odwiedzający mogą również zapisać się na listę powiadomień o komentarzach do wpisów aby uczestniczyć w konwersacji.','Add as many custom widgets as you like by dragging and dropping and customize each to fit your needs,
		including, Twitter streams, Facebook like boxes, custom images, Gravatars, tiled galleries, recent posts,
		or social icons.'=>'Dodaj dowolną liczbę własnych widżetów, przeciągając je i upuszczając, i dostosuj każdy z nich do swoich potrzeb,
		w tym strumienie Twittera, pola polubień na Facebooku, własne obrazki, awatary Gravatara, galerie kafelkowe, ostatnie wpisy
		lub ikonki społecznościowe.','Visitors can share your posts with Twitter, Facebook, Reddit, Digg, LinkedIn, print,
		and email. You can configure services to appear as icons, text, or both and some services like Twitter
		have additional options.'=>'Odwiedzający mogą udostępniać Twoje wpisy na Twitterze, Facebooku, Reddicie, Diggu, LinkedIn, w wersji drukowanej
		i e-mailem. Możesz skonfigurować usługi tak, aby wyświetlały się jako ikonki, tekst lub w obu formach, a niektóre usługi, takie jak Twitter,
		oferują dodatkowe opcje.','LaTeX is a powerful markup language for writing complex mathematical equations and formulas.
		Jetpack combines the power of LaTeX and the simplicity of WordPress to give you the ultimate
		in math blogging platforms. Use $latex your latex code here$ or [latex]your latex code here[/latex]
		to include in your posts and comments. Enjoy all sorts of options and embrace your inner nerd.'=>'LaTeX to potężny język znaczników do pisania złożonych równań i wzorów matematycznych.
		Jetpack łączy moc LaTeX-a z prostotą WordPressa, oferując Ci najwyższą
		możliwość tworzenia blogów matematycznych. Użyj $latex swojego kodu LaTeX tutaj$ lub [latex]swojego kodu LaTeX tutaj[/latex]
		do swoich wpisów i komentarzy. Ciesz się różnorodnością opcji i odkryj w sobie nerda.','You will receive instant notifications in your dashboard or your mobile device when somebody comments
		on any of your sites. Reply directly wherever you are to keep the conversation going.'=>'Otrzymasz natychmiastowe powiadomienia w kokpicie lub urządzeniu mobilnym, gdy ktoś skomentuje
		którąkolwiek z Twoich stron. Odpowiadaj bezpośrednio, gdziekolwiek jesteś, aby podtrzymać rozmowę.','Simple and concise statistics about your traffic. Jetpack Stats collects data on page views, likes, comments,
		locations, and top posts. View them in your dashboard or on WordPress.com.'=>'Proste i zwięzłe statystyki dotyczące ruchu. Jetpack Stats zbiera dane o wyświetleniach stron, polubieniach, komentarzach,
		lokalizacjach i najpopularniejszych wpisach. Możesz je przeglądać w kokpicie lub na WordPress.com.','Automatically share and promote newly published posts to Facebook, Tumblr,
		and LinkedIn. You can add connections for yourself or for all users on your site.'=>'Automatycznie udostępniaj i promuj nowo opublikowane wpisy na Facebooku, Tumblr
		i LinkedIn. Możesz dodawać kontakty dla siebie lub dla wszystkich użytkowników swojej witryny.','Grab short and simple links to your posts and pages using the compact wp.me domain name. Perfect
		for use on Twitter, Facebook, and in text messages where every character counts.'=>'Uzyskaj krótkie i proste odnośniki do swoich wpisów i stron, korzystając z kompaktowej nazwy domeny wp.me. Idealne
		do użytku na Twitterze, Facebooku i w wiadomościach tekstowych, gdzie liczy się każdy znak.','Easily and safely embed media from YouTube, Facebook, Flickr, Vimeo, Instagram,
		Google Maps, SlideShare, Vine, SoundCloud, and more. Just enter the appropriate shortcode directly into the
		editor and click “Publish.”'=>'Łatwo i bezpiecznie osadzaj multimedia z YouTube, Facebooka, Flickr, Vimeo, Instagrama,
		Map Google, SlideShare, Vine, SoundCloud i innych. Wystarczy wpisać odpowiedni krótki kod bezpośrednio w
		edytorze i kliknąć „Publikuj”.','Enhance plain Gravatar images with information about a person (including a name,
		bio, pictures, and contact info) when they leave a comment on one of your posts.'=>'Ulepsz zwykłe obrazki Gravatar, dodając informacje o osobie (w tym nazwę,
		biografię, zdjęcia i dane kontaktowe), gdy zostawi ona komentarz pod jednym z Twoich wpisów.','We keep a daily or real-time backup of your site so that when mistakes or accidents occur, restoring your
		site to any location takes a matter of minutes. Your site’s files are regularly scanned for unauthorized or
		suspicious modifications that could compromise your security and data. In many cases, we can fix them
		automatically (and will notify you). When we can’t, we provide you with expert support.'=>'Codziennie tworzymy kopię zapasową Twojej witryny w czasie rzeczywistym, dzięki czemu w przypadku błędów lub awarii przywrócenie
		witryny do dowolnej lokalizacji zajmuje zaledwie kilka minut. Pliki Twojej witryny są regularnie skanowane w poszukiwaniu nieautoryzowanych lub
		podejrzanych modyfikacji, które mogłyby naruszyć Twoje bezpieczeństwo i dane. W wielu przypadkach możemy je naprawić
		automatycznie (i powiadomimy Cię o tym). Jeśli nie uda nam się tego zrobić, zapewniamy Ci wsparcie ekspertów.','%s must be an array with visible and hidden items.'=>'%s musi być tabelą z widocznymi i ukrytymi pozycjami.','Failed loading required dependency Sharing_Service.'=>'Nieudane wczytanie wymaganych zależności Sharing_Service.','%1$s visible and hidden items must be a list of %2$s.'=>'%1$s widoczne i ukryte pozycje muszą być listą %2$s.','%s must be a Twitter username.'=>'%s musi być nazwą użytkownika Twittera.','%s must be a string.'=>'%s musi być ciągiem tekstowym.','Could not check updates for plugins on this site.'=>'Nie można sprawdzić czy wtyczki na tej stronie są zaktualizowane.','Unable to list plugins.'=>'Nie można wyświetlić listy wtyczek.','Plugin %s is not installed.'=>'Wtyczka %s nie jest zainstalowana.','Plugin found.'=>'Wtyczka znaleziona.','Missing options.'=>'Nieznana opcja.','Unable to create the Post by Email address. Please try again later.'=>'Nie można utworzyć wpisu przez e-mail. Spróbuj ponownie później.','Unable to regenerate the Post by Email address. Please try again later.'=>'Nie można ponownie utworzyć wpisu przez e-mail. Spróbuj ponownie później.','Invalid Akismet key. Please contact support.'=>'Niepoprawny klucz Akismet. Proszę skontaktować się z pomocą techniczną.','Site not verified with any service.'=>'Strona nie została zweryfikowana przez żadną z usług.','Your site is verified with %s.'=>'Twoja strona została zweryfikowana przez %s.','You need to register for VaultPress.'=>'Musisz się zarejestrować w VaultPress.','The requested Jetpack module is inactive.'=>'Wybrany moduł Jetpacka nie jest aktywny.','This site has no plugins.'=>'Ta strona nie ma zainstalowanych żadnych wtyczek.','Unable to delete the Post by Email address. Please try again later.'=>'Nie można usunąć wpisu przez e-mail. Spróbuj ponownie później.','All plugins are up-to-date. Keep up the good work!'=>'Wszystkie wtyczki są zaktualizowane. Tak trzymaj!','Your site is verified with %1$s and %2$s.'=>'Twoja strona została zweryfikowana przez %1$s i %2$s.','VaultPress is active and will back up your site soon.'=>'VaultPress jest aktywny i niedługo zacznie wykonywać kopie zapasowe twojej witryny.','%s is not a registered custom sharing service.'=>'%s nie jest zarejestrowanym własnym serwisem do udostępniania.','%1$s and %2$s'=>'%1$s i %2$s','Your site was successfully backed up %s ago.'=>'Kopia zapasowa Twojej witryny została pomyślnie utworzona %s temu.','%s plugin needs updating.'=>'%s wtyczka wymaga aktualizacji.' . "\0" . '%s wtyczki wymagają aktualizacji.' . "\0" . '%s wtyczek wymaga aktualizacji.','The module %s failed to be activated.'=>'Nie udało się włączyć %s modułu.' . "\0" . 'Nie udało się włączyć %s modułów.' . "\0" . 'Nie udało się włączyć %s modułów.','The module %s was activated.'=>'%s moduł został włączony.' . "\0" . '%s moduły zostały włączone.' . "\0" . '%s modułów zostało włączonych.','Feature Info'=>'Informacje o funkcji','%s must be a string prefixed with \'custom-\' and followed by a numeric ID.'=>'%s musi być ciągiem znaków poprzedzonym przedrostkiem \'custom-\' i następującym po nim numerycznym identyfikatorem.','%s needs sharing name, url and icon.'=>'%s wymaga udostępnienia nazwy, adresu URL i ikonki.','%s must be an array with sharing name, url and icon.'=>'%s musi być tablicą zawierającą wspólną nazwę, adres URL i ikonkę.','All modules activated.'=>'Wszystkie moduły włączone.','The requested Jetpack module could not be deactivated.'=>'Żądanego modułu Jetpack nie można wyłączyć.','The requested Jetpack module was deactivated.'=>'Żądany moduł Jetpack został wyłączony.','The requested Jetpack module was already inactive.'=>'Żądany moduł Jetpack był już wyłączony.','The requested Jetpack module could not be activated.'=>'Nie udało się włączyć żądanego modułu Jetpack.','The requested Jetpack module was activated.'=>'Żądany moduł Jetpack został włączony.','The requested Jetpack module was not found.'=>'Ż