ed.'=>'Wystąpił błąd.','You already have an account on this site. Please <a href="%1$s">sign in</a> with your username and password and then connect to WordPress.com.'=>'Masz już konto na tej stronie. <a href="%1$s">Zaloguj się</a>, podając swoją nazwę użytkownika i hasło, a następnie połącz się z WordPress.com.','Affects all sites in a Multisite network.Global'=>'Globalne','NounFormat:'=>'Format:','The video has been imported as Attachment ID %d'=>'Film został zaimportowany jako załącznik o identyfikatorze %d','Try again'=>'Spróbuj ponownie','Checking'=>'Sprawdzanie','Or'=>'Lub','Log in as <span>%s</span>'=>'Zaloguj się jako <span>%s</span>','Log in with username and password'=>'Zaloguj się za pomocą nazwy użytkownika oraz hasła','WhatsApp'=>'WhatsApp','share toWhatsApp'=>'WhatsApp','Click to share on WhatsApp'=>'Kliknij, aby udostępnić na WhatsApp','WordPress reports no SSL support'=>'WordPress informuje o braku obsługi SSL','share toTelegram'=>'Telegram','Your site could not connect to WordPress.com via HTTPS. This could be due to any number of reasons, including faulty SSL certificates, misconfigured or missing SSL libraries, or network issues.'=>'Twoja witryna nie mogła połączyć się z WordPress.com poprzez HTTPS. Powodów może być wiele, łącznie z wadliwymi certyfikatami SSL, źle skonfigurowanymi lub brakującymi bibliotekami SSL, lub problemami z siecią.','recipeIngredients'=>'Składniki','recipePrint'=>'Drukuj','recipeDifficulty'=>'Trudność','recipeTime'=>'Czas','recipeServings'=>'Porcje','Portfolio Archive Title'=>'Tytuł archiwum Portfolio','Telegram'=>'Telegram','recipeDirections'=>'Wskazówki','Response was not OK: '=>'Odpowiedź nie była OK: ','Must specify Twitter Timeline id or username.'=>'Należy podać identyfikator osi czasu Twittera lub nazwę użytkownika.','Portfolio Archive Content'=>'Zawartość archiwum portfolio','No location or theme ID provided in the untappd-menu shortcode.'=>'W krótkim kodzie untappd-menu nie podano identyfikatora lokaliza